"""
Given an array of integers that is already sorted in ascending order, find two numbers such that they add up to a specific target number.

The function twoSum should return indices of the two numbers such that they add up to the target, where index1 must be less than index2.

Note:

    Your returned answers (both index1 and index2) are not zero-based.
    You may assume that each input would have exactly one solution and you may not use the same element twice.

Example:

Input: numbers = [2,7,11,15], target = 9
Output: [1,2]
Explanation: The sum of 2 and 7 is 9. Therefore index1 = 1, index2 = 2.

注意下标要从1开始

分析：如果是遍历的话，复杂度是O(n^2)，可以用二分法？O(nlogn)

"""

class Solution(object):
    def twoSum(self, numbers, target):
        """
        :type numbers: List[int]
        :type target: int
        :rtype: List[int]
        """

        so = Solution()
        for index,item in enumerate(numbers):
            look = target - item
            numbers[index] = -10**100
            rs = so.binarySearch(numbers,look)
            if rs:
                return index+1,rs+1
        return False     

    def binarySearch(self,numbers,target):
        start = 0
        end = len(numbers) - 1
        while start <= end  :
            mid = (start + end )//2 
            if  target == numbers[mid]:
                return mid
            elif target > numbers[mid]:
                start = mid+1
            else:
                end = mid-1
        return 
        """
        超时了
        """
        # for index,item in enumerate(numbers):
        #     numbers[index] = 'x'
        #     if target - item in numbers[index+1:]:
        #         return [index+1, numbers.index(target-item)+1]
        # return False

    """
    a better solution
    键值互换

    把每个target-当前数字的差放入字典中，
    如果遍历到的数字已经在字典中，就找到了
    """
    def twoSum2(self, numbers, target):      
        dic = {}
        for i in range(len(numbers)):
            print("it is:",numbers[i])
            if numbers[i] in dic:
                return [dic[numbers[i]]+1, i+1]
            else:
                dic[target - numbers[i]] = i 
